import { FaBeer } from "react-icons/fa";



const UsersTable = ({item}) => {
    return (
        <tr>
            <td>{item.userName}</td>
            <td>{item.email}</td>
            <td>{item.lastName}</td>
            <td>{item.phoneNo}</td>
            <td>{item.address}</td>
            <td>Manager</td>
            <td>

<FaBeer />
 </td>
        </tr>
    );
}

export default UsersTable
